package com.hui.String;

import java.util.ArrayList;
import java.util.HashSet;
import java.util.List;
import java.util.Set;

/**
 * @author: shenhaizhilong
 * @date: 2018/8/24 8:04
 */
public class BuddyStrings {
    public boolean buddyStrings(String A, String B) {
        if(A == null || B == null || A.length() <2 || B.length() < 2)return false;
        if(A.length() != B.length())return false;
        char[] charA = A.toCharArray();
        for (int i = 0; i < charA.length -1; i++) {
            for (int j = i +1; j < charA.length ; j++) {
                if(charA[i] != charA[j])
                {
                    swap(charA,i, j);
                    if(String.valueOf(charA).equals(B))return true;
                    swap(charA,i, j);
                }else {
                    if(A.equals(B))return true;
                }
            }
        }
        return false;

}

private void swap(char[] array, int i, int j)
{
    char t = array[i];
    array[i] = array[j];
    array[j] = t;

}

    /**
     *
     * https://leetcode.com/problems/buddy-strings/discuss/141780/Easy-Understood
     * @param A
     * @param B
     * @return
     */
    public static boolean buddyStrings2(String A, String B) {
        if(A == null || B == null || A.length() <2 || B.length() < 2)return false;
        if (A.length() != B.length()) return false;

        // If A == B, we need swap two same characters. Check is duplicated char in A.
        if (A.equals(B)) {
            Set<Character> s = new HashSet<>();
            for (char c : A.toCharArray()) s.add(c);
            return s.size() < A.length();
        }
        //In other cases, we find index for A[i] != B[i]. There should be only 2 diffs and it's our one swap.
        List<Integer> diff = new ArrayList<>();
        for (int i = 0; i < A.length(); ++i)
        {
            if (A.charAt(i) != B.charAt(i))
                diff.add(i);
            if(diff.size() >2)
                return false;
        }

        return diff.size() == 2 && A.charAt(diff.get(0)) == B.charAt(diff.get(1)) && A.charAt(diff.get(1)) == B.charAt(diff.get(0));
    }


    public static boolean buddyStrings3(String A, String B) {
        if(A == null || B == null || A.length() <2 || B.length() < 2)return false;
        if (A.length() != B.length()) return false;
        int[] pos = new int[]{0, 1};
        int[] cnt = new int[26];
        int p = 0;
        boolean dup = false;
        for (int i = 0; i < A.length(); ++i) {
            if (A.charAt(i) != B.charAt(i)) {
                if (2 == p) return false;
                pos[p++] = i;
            }
            if (!dup && ++cnt[A.charAt(i) - 'a'] > 1) dup = true;
        }
        if (0 == p) return dup;
        return A.charAt(pos[0]) == B.charAt(pos[1]) && A.charAt(pos[1]) == B.charAt(pos[0]);
    }


    public static void main(String[] args) {
        BuddyStrings buddyStrings = new BuddyStrings();
        String str1 = "aac";
        String str2 = "aca";
        System.out.println(buddyStrings.buddyStrings(str1, str2));
        str1 = "";

        str2 = "";

        System.out.println(buddyStrings.buddyStrings2(str1, str2));
    }
}
